window.bookSummaryJSON = "<p>The last thing K-404 remembers is a happy home with the human child Ele, whose care is his primary purpose. So, when he wakes up in a landfill of tossed-away technology, his only thought is to reunite with his family.</p> <p>This world is not his own, though. It’s a wasteland of desolate buildings, flying metal disks, and monstrosities that keep themselves active by stealing another bot’s power.</p> <p>How did the world get this way?</p> <p>And why was he discarded?</p> <p>Hampered by imperfect memory, an obsolete body, and limited battery life, 404 sets out to find his home. Joined by other castaways, he faces off against scavengers and monsters, only to encounter greater threats.</p> <p>Pursued, outsmarted, and manipulated on every side, 404 teeters on the brink of annihilation. His only chance of survival? Those bits of himself—the connections—he hasn’t lost.</p>"; 
